import React, { Component } from 'react';

class Counter extends Component{
    constructor() {
        super();
        this.state = {
            contador: 0,
        };
    }

    render() {
        return (
            <div>
                <h1>Contador</h1>
                <h1>{this.state.contador}</h1>
                <div>
                    <button>-</button>
                    <button>+</button>
                </div>
            </div>
        );
    }

}

export default Counter;
